Raw Job Description:
Procare Group is an ever-growing national business of over 25 years. Our values are at the core of our business; Work Together, Be Accountable, Clarity in Communication and Find a Solution. At Procare Investigations, our vision is to be the most respected national rehab and wellbeing business in Australia with a focus on delivering high value for our customers through every interaction.

We value our people and know that fantastic talent is the only way to shape our future success. We’re all about building a high-performing team, where we embrace collaboration and new ways of thinking.

We are seeking an Open-Source Intelligence Case Analyst to join us, based in our Victorian Head Office in Burnley.

Reporting to the Intelligence Case Manager, the Open-source Intelligence Case Analyst is responsible for monitoring, assessing and investigating evidence and contributing to the production of detailed reports in line with our Service Level Agreement requirements.

In addition you will be supporting the operational needs within our Surveillance team, providing timely, accurate and effective assistance to all aspects of new and existing cases.

This is a full time, permanent position. 

About You

- Desire to work in surveillance & desktop investigations; insurance litigation and/or law enforcement;
- Proven administration/secretarial experience (1-2 years);
- Ability to prioritise, time manage and work autonomously;
- Excellent writing skills, grammar, spelling and report preparation abilities;
- Strong computer skills (Microsoft Office/Google Docs); as well as social media experience;
- Professional and mature-minded manner;
- Great customer focus and dedication;
- A meticulous eye for detail and accuracy.

What We Offer:

- Excellent remuneration package and generous uncapped consultant incentive bonus
- Welcome pack on commencement and the latest equipment including laptop and mobile
- Novated lease, purchased leave and salary sacrificing options
- Benefits to enhance your work-life balance like paid parental leave, access to our Employee Assistance Program, hybrid working arrangements, national secondment opportunities, and more!

Why Procare?

- Genuine and friendly working culture where our people are valued!
- Formal induction with regular and ongoing training opportunities;
- Genuine appreciation of work/life balance and flexibility;
- Volunteer Day to give back to the community;
- Social Club and quarterly social events, EOFY and Christmas events, quarterly and annual staff recognition awards, and more!

If you are looking to join a focused and driven team, as part of a family started company, have the drive to succeed and take pride in providing a high-quality service, we want to hear from you!

For more information, check out our website www.procareinvestigations.com.au or contact our careers team careers@procaregroup.com.au

