Purpose To act as a personal and confidential aide to the Member, in and out of Court, in connection with the Member's duties. To provide executive support to the Member regarding all activities required to administer the Member's case workload efficiently and effectively.
Key Duties 
- manage the Deputy President's chambers, including maintenance of the library, maintenance of
- the Deputy President's diary, confidential filing and indexing and filing decisions;
- manage the efficient and effective conduct of the Deputy President's courtroom including ensuring the availability of facilities, timely and accurately listing of matters, recording and safe custody of exhibits, custody of court files, attending to the Deputy President in court and recording orders made;
- provide professional support to the Deputy President, particularly in relation to managing hearings, conferences, appointments, travel arrangements, and incoming phone calls;
- conduct research of awards, orders, decisions and interpretations of the Court, the Commission and other jurisdictions as required by the Deputy President;
- prepare, vet, format and draft all documents relating to matters decided by the Deputy President e.g. decisions, amendments, awards, orders, agreements etc;
- liaise with the Registrar, Registry staff, parties, members of the legal profession, government departments, trade unions, employer groups, the media and the general public;
- maintain a high level of quality in the performance of all duties, ensuring adherence to the quality systems documentation for Associates and the administrative processes of the Registry;
- coordinate the workflows between the Deputy President and the Registry to ensure efficient and effective processes and to ensure the integrity of all documentation and tracking of all case matters allocated to the Deputy President; and
- attend to other duties as directed by the Deputy President from time to time.
Key Attributes – Are you the right person for the role? The ideal applicant will demonstrate the following key attributes as they apply to the key duties of the role:
- a genuine interest in industrial relations and employment law and a sound understanding of the work that the Court and Commission does. Applicants that can demonstrate familiarity with key legislation and industrial law jurisprudence will be highly regarded;
- education and personal maturity sufficient to enable the Associate to converse confidently with persons occupying high office in professional and social gatherings;
- sound organisational skills including an appreciation of the need for confidentiality, tact, discretion, initiative and reliability and the ability to manage time efficiently and work harmoniously with others and with minimum supervision;
- well-developed communication (written and oral) and interpersonal skills;
- personal resilience and maturity to deal with challenging situations; and
- high standard of competency and professionalism in office administration including keyboard and word processing skills and the ability to use computer-based file tracking systems.
How to apply  Applicants should provide a succinct Curriculum Vitae or Resume of information. Such information should include:
- a covering letter which addresses the key attributes and whether you will be able to fulfil the key duties;
- a recent copy of your academic transcript; and
- a succinct Curriculum Vitae or Resume of information, which includes comprehensive employment and educational information and, if previously employed, at least one referee with first-hand knowledge of your performance or, if not previously employed, a reference from your academic institution.

Applications should be emailed to QIRCinfoservices@qirc.qld.gov.au by 5:00pm on Wednesday, 15 October 2025.
For further information, head to www.qirc.qld.gov.au
